import React from 'react'

const Card = (props) => {
   
  return (
    <>
      <div className="Card">
        <div className="imagecr">
              <img src={props.src} alt="kjb" />
        </div>
        <div className="ti">
           {props.tit}
        </div>
        <div className="disc">
            {props.disc}
        </div>
      </div>
    </>
  )
}

export default Card
